import Body from "./components/Body";
import Data from "./components/Data";
import More from "./components/More";

const App = () => {
  return (
    <div>
      <div className="main">
        <Body />
      </div>
      <div>
        <Data />
      </div>
      <div>
        <More />
      </div>
    </div>
  );
};

export default App;
